import React from 'react';
import WorkoutLibrary from './components/WorkoutLibrary';
import './App.css';

function App() {
  return (
    <div className="min-h-screen bg-gray-50">
      <div className="container mx-auto py-8 px-4">
        <header className="text-center mb-8">
          <h1 className="text-3xl font-bold text-gray-900">Personalized Workout Library</h1>
          <p className="text-gray-600 mt-2">
            Browse through 20 customized workouts designed for fat loss and strength
          </p>
          <div className="mt-4 text-sm text-gray-500">
            Tailored for: Female, 35 years, 102kg, 176cm
          </div>
        </header>
        <WorkoutLibrary />
      </div>
    </div>
  );
}

export default App;
